class PandascanSidebar extends ContacthelperRayplicker {
    render() {
        const { t } = this.props;
        return (
            <div className="sidebar">

                {/* Follow Widget */}
                <div className="widget widget-follow">
                    <h5 className="widget-title">{t('followPandascanTitle')}</h5>
                    <div className="social-buttons">

